// TestStripNewlines was necessary because I forgot that an io.Writer should not change the buffer
// it receives as argument in place and thus weird things happened to me. This function will now be
// retained as a monument that reminds us of this error and the hours wasted forever.
func TestStripNewlines(t *testing.T) {
	examples := []string{
		"a\r\nb",
		"\r\nab",
		"ab\r\n",
		"abkjasklfjioewjfioejiojqio12345123482374983<p></p>jwefiojelqkjfioewjfoeiqw",
		"<h1 class=\"n1\"></h1>\r\n\n\n\n\r\n<h2 class=\"n1\"></h2>\r\n\n\n<h3 class=\"n1\">\n</h3>",
		"<h1 class=\"n1\"></h1>\r\n<h2 class=\"n1\"></h2>\r\n<h3 class=\"n1\"></h3>\n\n\n\n\n",
		"\n\n\n<input name=\"a\" value=\"123\"",
		"\n\n\n\n\n<h1 class=\"n1\"></h1>\r\n<h2 class=\"n1\"></h2>\r\n<h3 class=\"n1\"></h3>",
		"\n\n\n\n\n<h1 class=\"n1\"></h1>\r\n<h2 class=\"n1\"></h2>\r\n<h3 class=\"n1\"></h3>\n\n\n\n\n",
		"\n\n\n\n\n<h1 class=\"n1\"></h1>\r\n<h2 class=\"n1\"></h2>\r\n<h3 class=\"n1\"></h3>\n\n\n\n\n",
		longExample,
	}

	check := func(output, input []byte) (int, bool) {
		i, j := 0, 0

		for i < len(input) && j < len(output) {
			if input[i] == 10 || input[i] == 13 {
				i++
				continue
			}

			if input[i] != output[j] {
				fmt.Fprintf(os.Stderr, "i:%d j:%d", i, j)
				return i, false
			}

			i++
			j++
		}

		for i < len(input) {
			if input[i] != 10 && input[i] != 13 {
				break
			}
			i++
		}
		return i, i == len(input) && j == len(output)
	}

	for i := range examples {
		outputBuffer := new(bytes.Buffer)
		inputBytes := []byte(examples[i])
		readableInput := strings.ReplaceAll(strings.ReplaceAll(examples[i], "\r", "\\r"), "\n", "\\n")

		_, err := io.Copy(stripNewlines(outputBuffer), bytes.NewReader(inputBytes))
		if err != nil {
			t.Errorf("error in example %d (%s): %s", i, readableInput, err.Error())
		}

		outputBytes := outputBuffer.Bytes()
		readableOutput := strings.ReplaceAll(strings.ReplaceAll(string(outputBytes), "\r", "\\r"), "\n", "\\n")

		if errPos, ok := check(outputBytes, inputBytes); !ok {
			c := 0
			if errPos < len(inputBytes) {
				c = int(inputBytes[errPos])
			}
			t.Errorf("check failed in example %d (%s) at position %d in input (character %d). output is %s.\n", i, readableInput, errPos, c, readableOutput)
		}

	}

	// only the large example and now using one writer and calling write multiple times with
	// small chunks so that maybe we fuzz an error.
	example := longExample
	inputBytes := []byte(example)
	outputBuffer := new(bytes.Buffer)
	w := stripNewlines(outputBuffer)
	r := bytes.NewReader(inputBytes)
	readableInput := strings.ReplaceAll(strings.ReplaceAll(example, "\r", "\\r"), "\n", "\\n")
	n := 0
	for n < len(inputBytes) {
		chunkSize := rand.Intn(18)
		n += chunkSize
		_, err := io.CopyN(w, r, int64(chunkSize))
		if err != nil && err != io.EOF {
			t.Errorf("error in example %d (%s): %s", n, readableInput, err.Error())
		}
	}

	outputBytes := outputBuffer.Bytes()

	if errPos, ok := check(outputBytes, inputBytes); !ok {
		c := 0
		if errPos < len(inputBytes) {
			c = int(inputBytes[errPos])
		}
		t.Errorf("check failed in long example at position %d in input (character %d).\n", errPos, c)
	}
}

